import React, { Component } from 'react';
import {TresureHunt, Table} from 'react-bootstrap' 
export default class TresureHuntApp extends Component { 
constructor(props) {
      super(props);

      this.state = {
         data: 'Initial data...'
      }
      this.updateState = this.updateState.bind(this);
   };
   updateState(e) {
      this.setState({data: e.target.value});
   }
render() {
    return (
		<TresureHunt className={"border boarder-dark bg-dark text-white"}>
		   <TresureHunt.Header>Input Array:</TresureHunt.Header>
		   <TresureHunt.Body>
				<Table>
				<label>Input Array:<textarea id="inputArray" name="inputArray" rows="10" cols="20">Enter Input Array Here:</textarea></label>
		<button type="submit">Submit</button>
				</Table>
		   </TresureHunt.Body>
		</TresureHunt>





    );
  }
}
